&quot;In a way it was against my principles to do an old <a href="http://www.last.fm/tag/cover" class="bbcode_tag" rel="tag">cover</a> version because I'm so anti-retro. But it has this story, this narrative: there's a beginning and something happens in the middle and the ending is different. So many pop songs, especially with English lyrics, are just 900 different ways of saying 'she left me!' Which I actually love because it's pop, just one idea, very simple, but it doesn't mean it's cheap. I can relate to it, but I belong to the storytelling group.&quot;

